import React, { Component } from 'react';
import './Foods.css';

class Foods extends Component {
  constructor() {
    super();

    this.state = {
      Foods: []
    }
  }

  componentDidMount(){
    fetch('/api/foods')
      .then(res => res.json())
      .then(Foods => this.setState({Foods}, () => console.log('Food fetched', Foods)));
  }

  render() {
    return(
      <div>
        <h2>Foods</h2>
        <table>
          {this.state.Foods.map(Foods => 
            <th className="food-list" key={Foods._id}> {Foods.name} </th>
            )}
            {Foods.description} 

        </table>
      </div>
    );
  }
}

export default Foods;
